exports=async function(a,b){const{send:c}=require("http"),d=await c(`https://m.dmzj.com/info/${a}.html`,{...(b&&b.clientOptions),encoding:"utf-8","x-mobile":0});assertOK(d);let e=d.body;return e.subRegexAll(/,"data":(\[\{"id"[^\]]+\])/g).reverse().map(a=>JSON.parse(a).map(a=>({id:a.id+"",name:a.chapter_name,url:`https://m.dmzj.com/view/${a.comic_id}/${a.id}.html`})).reverse()).flat()};